import RayaAxiosClient from './raya-axios-client';

const getAuthToken = async (username, password, twoFactor) => {
  console.log('[authService] getAuthToken:');
  const result = await RayaAxiosClient.post('/api/admin/token',
    {
      username,
      password,
      twofactor,
    });
  console.log(result);
  return result;
};

export default {
  getAuthToken,
};
